// Community.js
// 커뮤니티 페이지
import React from 'react';

const Community = () => {
  return (
    <div className="community">
      <h1>커뮤니티 페이지</h1>
      <p>커뮤니티 관련 콘텐츠를 추가.</p>
    </div>
  );
};

export default Community;
